import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import {
  Route,
  NavLink,
  Link,
  BrowserRouter as Router,
  Switch
} from "react-router-dom";
import App from "./App";
import Login from "./Login";
import Contact from "./contact";
import Notfound from "./notfound";
import './css/stylesheet.css';

const routing = (
  <Router>
  	<div>
	      <ul>
	      	<div class="header">
	      		<Link class="hotbarFirst" to="/">
		      		<button class="hotbarButton hotbarName">
			      		Focus Pocus
		      		</button>
		      	</Link>
		      	<Link to="/"><button class="hotbarButton">Home</button></Link>
			    <Link to="/Login"><button class="hotbarButton">Login</button></Link>
			    <Link to="/"><button class="hotbarButton">Back Home</button></Link>
		    </div>
	      </ul>
	      <Switch>
	        <Route exact path="/" component={App} />
	        <Route path="/Login" component={Login} />
	        <Route path="/contact" component={Contact} />

	        <Route component={Notfound} />
	      </Switch>
      </div>
  </Router>
);

ReactDOM.render(routing, document.getElementById("root"));
